import React from "react";
import ReactDOM from "react-dom";
import Card from './componant/Card';
import Imformation from './componant/Imformation'
import './index.css'


ReactDOM.render(
  <>
    <h1 className="Heading">Top 5 Netflix Web Series</h1>
    <Card
      imgsrc={Imformation[0].imgsrc}
      category={Imformation[0].category}
      title={Imformation[0].title}
      link={Imformation[0].link}
    />
     <Card
      imgsrc={Imformation[1].imgsrc}
      category={Imformation[1].category}
      title={Imformation[1].title}
      link={Imformation[1].link}
    />
      <Card
      imgsrc={Imformation[2].imgsrc}
      category={Imformation[2].category}
      title={Imformation[2].title}
      link={Imformation[2].link}
    />
      <Card
      imgsrc={Imformation[3].imgsrc}
      category={Imformation[3].category}
      title={Imformation[3].title}
      link={Imformation[3].link}
    />
      <Card
      imgsrc={Imformation[4].imgsrc}
      category={Imformation[4].category}
      title={Imformation[4].title}
      link={Imformation[4].link}
    />
      <Card
      imgsrc={Imformation[5].imgsrc}
      category={Imformation[5].category}
      title={Imformation[5].title}
      link={Imformation[5].link}
    />
  </>,
  document.getElementById("root")
);
